R["fx__eu__@noaptwen__36"]="{['TS']=1625327940,['Effects']={[1]={['Yaw']=4.188790,['Y']=11986,['X']=95558,['SizeZ']=30,['Color']=102439,['Z']=69548,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1300,['Pitch']=4.799655,['Contrast']=1,['MetaData']={['message']='Page 4\\n\\nJe... je ne pensais pas que cela se passerait ainsi.\\nIl a toujours été impulsif... et voila ce que ça a donné...\\nSoulam espèce d\\'abruti!\\n\\nPage 5\\n\\nVoila plusieurs jours que je penche sur le problème. Il a forcément une séquence qui permet d\\'atteindre l\\'autre côté sans tomber.\\n\\n',['title']='Journal d\\'Anisa Arlkerk',},['Alpha']=1,['SizeX']=26.456456,},[2]={['Yaw']=3.141593,['Y']=3506,['X']=93555,['SizeZ']=30,['Color']=102439,['Z']=69756,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1301,['Pitch']=4.715880,['Contrast']=1,['MetaData']={['message']='Page 3\\n\\n\\n\\nJ\\'ai rejoins mon compagnon dans la salle de gauche mais nous sommes bloqués à présent.\\n\\n\\n\\nDes petites statuettes hornent les murs et on peut visiblement en changer les symboles.\\n\\n\\n\\nCela me rappelle quelque chose...',['title']='Journal d\\'Anisa Arlkerk',},['Alpha']=1,['SizeX']=26.456456,},[3]={['Yaw']=5.497787,['Y']=4102,['X']=93960,['SizeZ']=1100,['Color']=0,['Pitch']=1.567306,['SizeY']=1100,['Roll']=0,['Z']=69344,['Id']=1302,['EffectType']=878,['Contrast']=1,['Groups']=0,['Alpha']=1,['SizeX']=1020,},[4]={['Yaw']=3.141593,['Y']=11988,['X']=92975,['SizeZ']=30,['Color']=102439,['Z']=71047,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1303,['Pitch']=4.799655,['Contrast']=1,['MetaData']={['message']='Page 1\\n\\n\\n\\nEnfin nous l\\'avons trouvé!! \\n\\n\\n\\nAprès des années de recherche et de voyage à travers le désert. Un temple à la gloire de Morwha la déesse antique de la fertilité. \\n\\n\\n\\nJe n\\'imagine pas tout ce que nous allons trouver dans ce lieu rempli de mystère mais la tablette qui nous a permi de découvrir son emplacement, indique qu\\'un puissant artéfact se cache en son sein. \\n\\nLes yokudans ont placé de nombreux pièges pour éviter aux infidèles de pilier cet endroit. J\\'espère que les quelques indices que nous avons pu traduire de cette tablette nous aiderons à arriver à notre but.',['title']='Journal d\\'Anisa Arlkerk\\n ',},['Alpha']=1,['SizeX']=26.456456,},[5]={['Yaw']=3.316126,['Y']=3323,['X']=91432,['SizeZ']=30,['Color']=91552,['Z']=72226,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1304,['Pitch']=4.712564,['Contrast']=1,['MetaData']={['message']='Page 2\\n\\n\\n\\nSoulam et moi nous sommes séparés. Il n\\'a pas voulu commencer par cette salle quand bien même la tablette indiquait qu\\'elle était primordiale\\n\\n\\n\\n... soit disant que les aventuriers ne vont jamais à droite... \\n\\n\\n\\nJ\\'étais rétissante à l\\'idée de nous séparer mais à présent que je franchis la porte je suis heureuse de n\\'avoir pas à partager ce moment.\\n\\nCette statue lion ibis est magnifique tout comme ces fleurs. Ce temple est une découverte archéologique fabuleuse. \\n\\n\\n\\nJ\\'ai senti la présence d\\'un sort mais il ne s\\'agit pas d\\'un piège, je pense que les anciens prêtres avaient mis en place des sortilèges de conservation pour conserver ces plantes ainsi. \\n\\n\\n\\nIl doit y avoir plus mais pour le moment je vais me contenter de rendre hommage à la statue.',['title']='Journal d\\'Anisa Arlkerk\\n ',},['Alpha']=1,['SizeX']=26.456456,},[6]={['Yaw']=5.571091,['Y']=3552,['X']=95443,['SizeZ']=260,['Color']=0,['Z']=70666,['Groups']=0,['SizeY']=260,['Roll']=0,['EffectType']=4402,['Id']=1305,['Pitch']=0,['Contrast']=0.010000,['MetaData']={['message']='Favorite du premier\\n\\nTu n\\'en restes pas moins l\\'une des sept\\n\\nDe tes quatres bras tu embrasses les autres\\n\\nEt permets la naissance de tous\\n\\nQuand nous mortel t\\'appelons\\n\\nTu nous donnes de quoi renaitre en ton nom\\n\\n\\n\\n',},['Alpha']=1,['SizeX']=520,},[7]={['Yaw']=0,['Y']=3315,['X']=94944,['SizeZ']=30,['Color']=554525,['Z']=70441,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1306,['Pitch']=4.712564,['Contrast']=1,['MetaData']={['message']='Bénie d\\'Onsi, Satakalaam : où les guerriers sont les plus courageux d\\'Alik\\'r.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Tava, Satakalaam : où les autours nichent sur la tour du grand temple.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Morwha, Satakalaam : où les abeilles portent le pollen des grenades et des figues.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Zeht, Satakalaam : où l\\'eau du rocher coule et emplit fontaines et cruches.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Tu\\'whacca, Satakalaam : où Motalion garde nos ancêtres des ères antérieures.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Ruptga, Satakalaam : où les étoiles brillent pour guider notre Errance.\\n\\n\\n\\n\\n\\n\\n\\nBénie de Satakal, Satakalaam: où nous protégerons la vraie foi jusqu\\'à l\\'appel de la Fin du monde. ',['title']='Saint, très saint Satakalaam\\n ',},['Alpha']=1,['SizeX']=26.456456,},[8]={['Yaw']=4.625123,['Y']=2555,['X']=94805,['SizeZ']=30,['Color']=101140,['Z']=72001,['Groups']=0,['SizeY']=30,['Roll']=0,['EffectType']=8501,['Id']=1307,['Pitch']=4.597197,['Contrast']=1,['MetaData']={['message']='Page 8\\n\\n\\n\\nVoici donc le trésors que renferme ce temple.\\n\\nEtrange la tablette parlait d\\'un artefact, un puissant artefact...\\n\\nIl doit sans doute être au milieu de tout ces richesses. \\n\\n\\n\\nSi je veux pouvoir sortir d\\'ici il va falloir que je le trouve.\\n\\n\\n\\n\\n\\nPage 9\\n\\n\\n\\nApres plusieurs heures de recherche je l\\'ai trouvé... mais... ce n\\'était pas ce que je pensais...\\n\\nJ\\'ai mal au crâne... comme si tout se brouillait... comme si...\\n\\n\\n\\nquel est mon nom... je... tellement de pouvoir... mais... contre quoi...\\n\\n\\n\\nNuzhimeh... pourquoi j\\'entends ce nom sans cesse... est-ce mon nom?... \\n\\n\\n\\noui Nuzhimeh ... c\\'est ça.. je suis Nuzhimeh... le djin au service de Morwha!',['title']='Journal d\\'Anisa Arlkerk\\n ',},['Alpha']=1,['SizeX']=26.456456,},[9]={['Yaw']=2.268928,['Y']=3552,['X']=95662,['SizeZ']=60,['Color']=994870,['Z']=74860,['Groups']=0,['SizeY']=60,['Roll']=0,['EffectType']=4402,['Id']=1308,['Pitch']=0,['Contrast']=1,['MetaData']={['message']='Que desirez vous Maitre?\\nSouhaitez-vous faire vos 2 voeux \\nrestants afin de sortir d\\'ici \\nou voulez-vous me liberer?',},['Alpha']=1,['SizeX']=340,},[10]={['Yaw']=3.839724,['Y']=10994,['X']=89150,['SizeZ']=50,['Color']=427698,['Z']=67685,['Groups']=0,['SizeY']=50,['Roll']=0,['EffectType']=8502,['Id']=1313,['Pitch']=0,['Contrast']=3.500000,['MetaData']={['message']='Bienvenue à tous pour cette nouvelle aventure.\\n\\nPour profiter un maximum de ce donjon quelques consignes à respecter:\\n\\n- Attendez vos compagnons avant d\\'interragir avec un objet ou de résoudre une énigme (vous pouvez lire les livres sans danger). Essayez également de rester grouper un maximum (les retardataires sont souvent victimes d\\'emmurement...)\\n\\n-Les livres que vous trouverez sont là pour vous aider donc n\\'hésitez pas à les lire.\\n\\n-Dans le cas où vous auriez un.. accident malencontreux, ne revenez pas à l\\'entrée mais faites un: /me vient de mourrir. Vous serez alors \"débloqués\" par les mystérieuses forces de ce donjon, pour poursuivre l\\'aventure en fantôme.\\n\\n-les actions à votre disposition pour résoudre des énigmes sont les suivantes: intéraction avec tous types d\\'objet, donner une réponse via le chat /say ou /zone, utiliser une émote (il faudra que l\\'ensemble du groupe la fasse ensemble), activer un memento, se tenir à un endroit précis... \\n\\n-Dernière consigne: si vous avez besoin d\\'indice suplémentaire vous pouvez  faire appel aux âmes érrantes de ce lieu qui vous aideront.. peut-être. Tapez /me commence à paniquer car il n\\'a plus de.. (nourriture, temps, alcool,.. à vous de choisir) et vous aurez de l\\'aide.\\n\\nBonne aventure!!',['title']='Introduction',},['Alpha']=1,['SizeX']=46.456456,},[11]={['Yaw']=0.959931,['Y']=3634,['X']=97483,['SizeZ']=60,['Color']=994168,['Z']=74881,['Groups']=0,['SizeY']=60,['Roll']=0,['EffectType']=4402,['Id']=1316,['Pitch']=0,['Contrast']=1,['MetaData']={['message']='Bonjour Maitre.\\nVous avez trois voeux \\ndites moi ce que vous dEsirez',},['Alpha']=1,['SizeX']=260,},},['Version']=1744,}"
