R["fx__@shours"]="{['HouseId']=76,['Effects']={[1]={['X']=70584,['SizeY']=640,['Z']=78458,['Color']=999999,['Groups']=0,['SizeX']=600,['Id']=1003,['Roll']=0,['Y']=7419,['Contrast']=1,['SizeZ']=640,['Yaw']=5.585054,['Alpha']=1,['Pitch']=6.195919,['EffectType']=4527,},[2]={['X']=71409,['SizeY']=40,['Pitch']=4.712564,['Color']=307499,['Groups']=0,['Id']=1004,['SizeX']=29.456456,['Roll']=0,['Contrast']=1.600000,['Y']=7484,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus - Einleitung',['message']='von Ajo\\'Shuzaji, Kumashivat, 15\\n\\nNach dem diese Ihr detektivisches Genie erfolgreich unter Beweis gestellt hat und großartigem Mizzik half, garstige Verbrechen in Stormfeste aufzudecken, erhielt Ajo\\'Shuzaji endlich ihren ersten, eigenen wichtigen Auftrag.\\n \\nAjo erhielt wertvollen Brief. Darin war die Rede von Mord! Dunkle Monde, diese war schneller an Tatort als Mibek aus Vorratskammer, wenn diese nachts ihre Vorratskammer auf diebische Nagetiere überprüft und vielleicht einen Mondzuckersüßkringel mit in Bett nimmt.\\n\\nNatürlich war örtliche Polizei bereits verständigt und Mormer Tythis war bereits vor Ort. Sein kriminalistisches Gespür ist aber nicht dichter als sein Fell und so hat diese keine Hilfe von örtlichen Behörden erwartet. \\n\\n\\n\\n\\n\\n\\n\\nDies ist Bericht von Ajo\\'Shuzaji. \\nJara hazura an jaja hazura vara thzi.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nWarnung: Dieser Bericht ist ein Spoiler für @Turcaills Quest \"Mord im Herrenhaus\"',},['SizeZ']=40,['Yaw']=1.570796,['Alpha']=1,['Z']=80391,['EffectType']=8502,},[3]={['X']=71431,['SizeY']=28,['Pitch']=4.712564,['Color']=174999,['Groups']=0,['Id']=1007,['SizeX']=23.456456,['Roll']=0,['Contrast']=0.560000,['Y']=7484,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus I',['message']='Teil 1: Erster Eindruck\\n\\nWie Detektiv Vale und Mizzik Donnerstiefen immer betonen ist erster Eindruck am wichtigsten. Ajos Sinne sind ebenso scharf wie ihre Krallen und anders als unterbezahlter Polizist sah diese gleich, dass hier etwas nach fauligem Fisch roch: Es war gar kein Mord.\\n\\nDiese Schulssfolgerung war offensichtlich, wenn Ermittler nicht vollkommen badabi ist. Anstatt echte Leiche zu finden, sah Ajo Zombie auf Boden liegen und jeder Ja-Khajiit weiß, sind Zombies untot. Daraus folgt zum einen, dass er nicht umgebracht wurde, und zum anderen, dass es keine Tat gegen Lebewesen war. \\n\\nKurz: Entweder es war Mordversuch von dummen, dummen Möchtegernmörder oder einfach langweilige Sachbeschädigung. \\n\\n\\nDa diese aber bei allen Monden geschworen hat, schreckliches, wenn auch nicht wirklich schreckliches Verbrechen aufzuklären, setzte diese ihre Arbeit gewissenhaft fort. Gut. Versprochene Belohnung half auch.\\n\\nZunächst untersuchte diese sorgfältig Unleiche Igor und stellte fest, dass Tatwerkzeug einfaches Messer aus Küche war. Dieses steckte in Schulter von Opfer. Schlampig ausgeführte Tat. Täter war wohl in Eile, sehr ungeübt oder hatte wirklich wirklich langsame Pfoten.\\n\\nUnter Leiche und Blutlache bemerkte Ajo, der niemals schwindelig wird von Blut, eine Rolle Papyrus oder Pergament - eine Karte. Interessant. Wie Vale und Mizzik, schrieb diese alle Ergebnisse sofort in schlaues Notizbuch. Jetzt hieß es, Verdächtige feststellen, Anwesende befragen und Hinweise suchen. Diese widerstand dem Drang, in Küche anzufangen und sprach zunächst mit Hausherr Biro-Dar.',},['SizeZ']=28,['Yaw']=3.752458,['Alpha']=1,['Z']=80119,['EffectType']=8501,},[4]={['X']=71389,['SizeY']=27,['Pitch']=4.712564,['Color']=175099,['Groups']=0,['Id']=1008,['SizeX']=22.456456,['Roll']=0,['Contrast']=0.630000,['Y']=7485,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus II',['message']='Teil II: Biro-Dar\\nBiro-Dar ist Besitzer von Haus und \"Opfer\" Igor und empfing mich in Gelehrtengewändern in seinem Arbeitszimmer. Ha! Hält er diese für Wafiit? Damit kann er haarlose Varzeva täuschen aber nicht Ajo\\'Shuzaji! \\n\\nDiese hat gelernt, bei Verhör zuzuhören und stellte sich nur kurz als Sonderermittlerin Ajo\\'Shuzaji\\'Ra vor. Niemand nennt diese Ra, es macht aber immer Eindruck. Auch dieses Mal. Biro wand sich wie Aal in Sand und stritt alles ab: Missverständnis mit Wache, Missverständnis mit Händler, Missverständnis mit Bänker, mehr Missverständnisse als Sand in Khenarthis Wind an sonnigem Tag! Verdächtig. Noch verdächtiger war, dass dieser Ajo als Mitglied der Diebesgilde erkannte, wo diese Tarnidentität aus anderem Fall angenommen hat. Noch verdächtiger! \\n\\nDann sprach Biro davon, dass er zu Geld gekommen sei und lud diese zu Essen ein! Entweder versuchte er diese bestechen oder schamlos anzumachen. Gajithozay! Diese hat aber mehr Verehrer als Qara\\'a auf Fischmarkt und lehnte selbstverständlich ab. \\n\\nAls Biro-Dar mit Schwanz zwischen Beinen abzog, bemerkte diese Tagebuch auf Schreibtisch. Mit linker, flinker Kralle hob diese Deckel und blätterte schnell darin. Biro-Dar hat Zugang zu Garten gesperrt, damit Polizei nicht die Blumen zertritt. Blumen? Für wie kurz hält dieser Ajos Schnurrhaare? Schnell schrieb diese Garten in Notizbuch und kreiste Wort zwei Mal ein. Zur Sicherheit!\\n\\nInteressant war, dass Biro sich tatsächlich über Angriff auf Igor ärgerte. Dies muss Ajo als entlastendes Detail zu Gunsten des verdorbenen Zuckermauls notieren, auch wenn es dieser widerstrebte.\\n\\nAjo entging auch nicht die Information, dass Nuzhimeh, die rothwardonische Dinstmagt wohl nachts mit Jorn im Mondzuckerfeld tanzt. Diese musste mit beiden sprechen.',},['SizeZ']=27,['Yaw']=4.181809,['Alpha']=1,['Z']=80141,['EffectType']=8501,},[5]={['X']=71370,['SizeY']=28,['Pitch']=4.712564,['Color']=102439,['Groups']=0,['Id']=1009,['SizeX']=22.456456,['Roll']=0,['Contrast']=1.400000,['Y']=7485,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus III',['message']='Teil 3: Jorn und Nuzhimeh \\n\\nSprechen war viel gewünscht. Trotz bester Verhörmethoden und Ajos ganzem Charme, weigerte sich Jorn mit dieser zu sprechen und ließ diese auch nicht in Garten! Nur als diese Nizhimeh erwähnte, huschte Lächeln über sonst steinernes Nordgesicht. Wenig erfahren und viel gelernt. Dieser ist treu, doof, treudoof und professionell. Jorn wüsste, wie man Zombies beseitigt. Schließlich laufen mehr Tote Nord durch Gewölbe als sich lebendige in Wirtshäusern mit Med auf die Intelligenz von Jorn trinken. Und das sind nicht wenige!\\n\\nNuzhimeh war auch eher mäh. Sie bot mir an, mir Waren abzukaufen und bezahlte ordentlich dafür. Verdächtig, woher einfache Hausangestellte so viel Geld hat. Diese gab Ajo aber auch ein-zwei Süßkringel. Vielleicht auch drei. So gut wie diese dieser geschmeckt haben, kann Nuzhimeh kein Tunichgut sein! Süßkringel gelingen nur mit großem Herz und viel Mondzucker. Schlechte Jiit können nicht backen. Dies sind die Worte und die Worte sind wahr!\\n\\nNach diesem Teilerfolg - Süßkringel waren wirklich lecker - hat sich diese auf großspurigen Nord Hroltar fokussiert. ',},['SizeZ']=28,['Yaw']=4.276057,['Alpha']=1,['Z']=80184,['EffectType']=8501,},[6]={['X']=71369,['SizeY']=28,['Pitch']=4.708898,['Color']=102439,['Groups']=0,['Id']=1010,['SizeX']=22.456456,['Roll']=0,['Contrast']=1.310000,['Y']=7485,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus IV',['message']='Teil 4: Hroltar und Pirharris Zimmer\\n\\nHroltar prahlte mit Geschichten von großen Langnasenhorkern, Nords, die lebendige Nords mit Äxten töten, Nords, die tote Nords mit Äxten töten, mit Nord-Reichen und Nord Reiken und vor allem mit Frauengeschichten. Wobei diese nicht glaubt, dass Geschlecht dabei wichtig ist. Wie der Nord haarlosen Polizisten attraktiv finden konnte - diese konnte kaum zuhören. Wäre Hroltar nicht stumpf wie Fell von skoomasüchtiger Alfiq wären seine Geschichten gute Taktik gewesen, um diese hier auf falsche Spur zu führen. \\n\\nDiese war aber wach wie Ja\\'khajiit nach doppelter Portion Mondzuckerpudding als Hroltar von Streit mit Pirharri \"Süßkringelsüchtige Irre\" nannte er sie. Daraus folgten zwei Fragen: Wer wer Pirharri und hat Hroltar Süßkringel von Nuzhimeh probiert? Wohl kaum. Trotzdem interessant!\\n\\n\\nPirharri war nicht leicht zu finden. Ihr Zimmer schon. Ajo brauchte nur Geruch von köstlichen Süßkringeln zu folgen. Und diese hatte Hroltar gefragt. Im Zimmer fand diese Süßkringel unter Bett, Süßkringel auf Schrank und Süßkringel auf Buch. Klebrig-süß, verführerisch wie Felsen in warmen Sand an arbeitsreichem Tag ... \\n\\nHier war wenig Interessantes zu lesen. Nur wahre Worte über Nuhzimehs Süßkringel und seltsame Bemerkung zu grusligem Schuppen. Diese machte sich notizen. \"Man weiß nie, junge Ajo\", pflegte Mizzik immer zu sagen. Alter Charmeur.',},['SizeZ']=28,['Yaw']=4.967207,['Alpha']=1,['Z']=80223,['EffectType']=8501,},[7]={['X']=71377,['SizeY']=28,['Pitch']=4.712564,['Color']=102439,['Groups']=0,['Id']=1011,['SizeX']=22.456456,['Roll']=0,['Contrast']=1,['Y']=7484,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus V',['message']='Teil 5: Schlechte Idee und Kommissar Zufall\\n\\nDiese beschloss nach Weg in verbotenen Garten zu suchen. Nur wie käme diese dorthin? Der erste Gedanke war, aus Fenster zu klettern. Erste Gedanken sind nicht immer beste Gedanken. Diese fiel 200 Meter tief in kaltes Wasser und musste 1000 Schlachterfische mit bloßen Krallen aufschlitzen, um dann an felsiger Wand wieder mühsam hochzuklettern. Oben angekommen, stand Ajo aber nicht in Pirharris Zimmer sondern woanders im Haus. Glücklicherweise lag ein Handtuch neben Bett, dass sich diese erst ausleihen und dann unauffällig unter Bett schieben konnte und hatte Glück ...\\n\\nKommissar Zufall, wie Mizzik soetwas nannte, brachte dieser noch ein Tagebuch, ohne Namen und mit unbekannter Handschrift, aber mit interessantem Hinweisen: Pirharri hatte Weg in Garten gefunden! Was Frage aufwarf: Woher wusste Schreiber, das Pirharri im Garten war?\\n\\nNoch mehr Gründe in Garten zu kommen. In Gedanken schlenderte Ajo aus Zimmer und übersah fast wichtigstes Detail! In Zimmer lag gleiche Karte wie unter Igor! Auch dieses Detail musste in Notizblock festgehalten werden.',},['SizeZ']=28,['Yaw']=4.977679,['Alpha']=1,['Z']=80261,['EffectType']=8501,},[8]={['X']=71389,['SizeY']=28,['Pitch']=4.712564,['Color']=102439,['Groups']=0,['Id']=1012,['SizeX']=23.456456,['Roll']=0,['Contrast']=1,['Y']=7484,['MetaData']={['title']='Bericht zum Verbrechen in Trurcaills Herrenhaus VI',['message']='Teil 6: Gutes Bauchgefühl\\n\\nWarum verlässt sich diese nicht auf ihr Bauchgefühl! Bauch sagte von Anfang an: suche in Küche. Jetzt, nach langen Geschichten von Missverständnissen, toten und lebendigen Nords, Matratzenfantastik, einem Sturz in Schlachterfischesee und glücklicherweise auch Süßkringeln, gelangte diese in Küche und sah sofort Tablett mit Süßkringeln auf Tisch. \\n\\nDiese wollte gerade heimlich süßen Kringel einstecken, um diesen als Beweismittel zu sichern, als ihr eine Spur Sirup am Tischrand auffiel. Diese folgte Spur und sah, dass jemand Süßkringel auf Boden fallen lassen hat: Neben Krümeln, die bei Verzehr von Süßkringel immer überall hinfallen, lag auch Glasur auf Boden. Ergo, was Vale immer sagt, wenn er wichtige Hinweise findet, es war Unfall. Niemand verschwendet Glasur!\\n\\nAjo bemerkte als diese ganz nah an Glasurspur heranging, das sich Krümel in Hinterzimmer fortsetzen. Wie Senche-Rath folgte diese weiteren Krümeln, kletterte auf Regal und durch komisches, in Zimmer wachsendes Efeu nach draußen und stand plötzlich in Garten. Bauchgefühl, niemals wird diese dich wieder ignorieren!',},['SizeZ']=28,['Yaw']=5.235988,['Alpha']=1,['Z']=80295,['EffectType']=8501,},[9]={['X']=71420,['SizeY']=28,['Pitch']=4.712564,['Color']=102439,['Groups']=0,['Id']=1013,['SizeX']=22.456456,['Roll']=0,['Contrast']=0.970000,['Y']=7487,['MetaData']={['title']='Bericht zum Verbrechen in Turcaills Herrenhaus VII',['message']='Teil 7: Garten\\n\\nIn Garten fand diese nur wenige Blumen, welche von Polizei zertrampelt werden könnten. Anderseits ist diese keine Botanikerin und weiß nicht, ob Blumen selten oder teuer sind. Viel interessanter als Blumen war in Tagebüchern beschriebene, ominöse Schuppen. Wirklich furchteinflößend stand dieser im Garten und leuchtete in roter Aura. \\n\\nAjo hat schlimmeres gesehen. Zum Beispiel wie Hroltar unfähigen Polizisten anschmachtet. Also ist diese mit mutigen, großen Schritten in Schuppen gesprungen und war bereit Horden von Daedra in Stücke zu reißen, fand aber nichts anderes als Karten. Große Karten, kleine Karten, Karten an Wänden, Karten auf Tisch, Karten an Decke - nein, diese zieht Leser an Schwanz: An Decke war keine Karte. Karten waren aber sonst überall. \\n\\nFast hätte diese ein Buch übersehen. Vorsichtig, wieder mit linker Kralle, öffnete diese es und erwartete Portale nach Oblivion oder mindestens in Sheogoraths verrückte Träume. Stattdessen fand Ajo Zahlen und Namen von Kunden. Interessant! Diese war sich sicher zu wissen, wer Täter ist und schlenderte nach draußen, wo Pirharri fast ihren Berg Süßkringel fallen ließ.\\n\\nEndlich konnte Ajo Pirharri vernehmen. Sicher war sie Hauptverdächtige für stumpen Elf und zuushi Nord. Schuldig war sie auch. Schuldig in Diebstahl von Süßkringel im großen Stil! Nachedm Pirharri dieser aber versicherte, dass diese nur für Eigenbedarf genommen und somit technisch gar nicht gestohlen war und etwas widerwillig einen Süßkringel mit dieser teilte, ist sich Ajo sicher: Pirharri ist unschuldig.\\n\\nSo ließ diese Pirharri in ihrem geheimen Lager und schlich sich leiser als ein Dagi-Rath zurück in Herrenhaus und legte sich auf die Lauer.',},['SizeZ']=28,['Yaw']=2.785545,['Alpha']=1,['Z']=80326,['EffectType']=8501,},[10]={['X']=71466,['SizeY']=46,['Pitch']=4.712564,['Color']=203069,['Groups']=0,['Id']=1014,['SizeX']=27.456456,['Roll']=0,['Contrast']=1,['Y']=7483,['MetaData']={['title']='Bericht zum Verbrechen in Turcaill Herrenhaus - Fazit',['message']='Wie bereits lange geschlussfolgert, stellten sich Ajos Vermutungen als richtig heraus. Völlig unbemerkt bewegte sich eine weitere Person durch das Haus: Historikerin Phedre. Unschuldig wie Morgentau in Jodes Licht versteckte sie sich vor aller Augen hinter Bücher und Karten. Genau. Karten. Diese muss zugeben, lange selbst über dieses Detail hinweg geschaut zu haben: In Schuppen war es aber offensichtlich. Jemand handelte mit Karten. Jemand, der sich auskannte. \\n\\nBiro konnte es nicht sein. Alte Dariit hält Karte verkehrtherum. Und auf dem Kopf. Dieser ist sicher ein Gauner und Ganove. Unschuldig? Nein. Igor hat er aber nicht angegriffen.\\n\\nNuzhimeh kauf Dinge, tut dies aber nicht heimlich. Außerdem macht sie wundervolle Süßkringel. Darin ist sie schuldig, wie kaum eine schuldig sein kann. \\n\\nJorn ist zu dumpf zum Lesen und zu treu, um krumme Geschäfte zu machen.\\n\\nPirharri mag Süßkringelsüchtig sein und diese ist sicher, Pirharri gesehen zu haben, wie die ein Diebesgildenunterschlüpfen zweifelhafte Wahren verkauft. Igor hat sie aber nicht angegriffen. Nur Süßkringel und auch nur für ihren Eigenbedarf. Diese schwört bei Jone und Jode, dass es kein einziger Süßkringel mehr war.\\n\\nHroltar wäre auf Schatzsuche losgestürmt und kann auch kein Geheimnis für sich behalten. Dieser Nord ist Aufschneider, Schürzenjäger, Trunkenbold und vieles anderes, ja. Igor ist für ihn aber nicht von Interesse. \\n\\nErgo: Es musste unsichtbare dritte oder fünfte Person sein. Jemand, der Wert von Karten kennt und diese auch verkauft und wer kennt sich besser aus als Historiker? Eben. \\n\\nPhedre musse die Täterin sein. \\n\\nAjo\\'Shuzaji, Sonderermittlerin\\n\\nFür die Quest zu diesem Bericht: @Turcaill fragen',},['SizeZ']=46,['Yaw']=4.712389,['Alpha']=1,['Z']=80950,['EffectType']=8503,},},['TS']=1611320264,['World']='eu',['Version']='16.0.9',}"
