R["fx__@vanchningth"]="{['Houses']={[1]={['Version']='16.0.2',['Effects']={[1]={['Pitch']=0,['SizeZ']=1087,['EffectType']=207,['Yaw']=5.188864,['Id']=1076,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=104588,['Z']=88404,['Y']=11107,},[2]={['Pitch']=0,['SizeZ']=1087,['EffectType']=205,['Yaw']=2.045526,['Id']=1077,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=103406,['Z']=89010,['Y']=11108,},[3]={['X']=103136,['SizeZ']=439,['Yaw']=0.441570,['Id']=1078,['EffectType']=867,['Alpha']=1,['Color']=999999,['SizeX']=293.285710,['Roll']=0,['Contrast']=1,['Groups']=0,['Pitch']=0,['SizeY']=439,['Z']=87005,['Y']=10924,},[4]={['Pitch']=0,['SizeZ']=1087,['EffectType']=387,['Yaw']=5.187120,['Id']=1080,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=103956,['Z']=87125,['Y']=11032,},[5]={['Pitch']=0,['SizeZ']=1087,['EffectType']=322,['Yaw']=2.043781,['Id']=1081,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=102754,['Z']=87748,['Y']=11028,},[6]={['Pitch']=0,['SizeZ']=1087,['EffectType']=725,['Yaw']=2.043781,['Id']=1087,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=104047,['Z']=90259,['Y']=11013,},[7]={['Pitch']=0,['SizeZ']=1087,['EffectType']=314,['Yaw']=5.185373,['Id']=1090,['Contrast']=1,['Alpha']=1,['Color']=999999,['SizeX']=1260,['Roll']=0,['SizeY']=1087,['Groups']=0,['MetaData']={['offset % (x)']=0,['scale % (y)']=100,['offset % (y)']=0,['scale % (x)']=100,},['X']=105245,['Z']=89638,['Y']=10997,},[8]={['X']=104920,['SizeZ']=600,['Yaw']=2.043781,['Id']=1091,['EffectType']=4580,['Alpha']=1,['Color']=999999,['SizeX']=600,['Roll']=0,['Contrast']=1,['Groups']=0,['Pitch']=0,['SizeY']=600,['Z']=91678,['Y']=10698,},},['TS']=1610129757,['HouseId']=70,['World']='eu',},[2]={['Version']='16.0.2',['Effects']={[1]={['Pitch']=1.570971,['SizeZ']=30,['EffectType']=8501,['Yaw']=1.747075,['Id']=1070,['Contrast']=1,['Alpha']=0,['Color']=102439,['SizeX']=26.456456,['Roll']=0,['SizeY']=30,['Groups']=0,['MetaData']={['title']='Duboths Tagebuch, Band 1',['message']='Niemand darf hiervon erfahren. Mein Experiment war ein Erfolg ... gewissermaßen. Ich hatte die Sphäre fertiggestellt, als sie mich, meine Essenz, in sich hinein sog. Ich verweilte dort in Stasis, für mich stand die Zeit schlichtweg still. Das nächste, wovon ich weiß, ist, dass diese ... \"Dunmer\" über die Sphäre gestolpert ist und ich aus ihr befreit wurde. Mein Körper wurde verwundet, jedoch nicht schwer. Meine rechte Körperhälfte ist übersät von Brandnarben, als wären sie während meiner Zeit dort drin tatsächlich geheilt. Ich wette, das Ätherium in meiner Rüstung hat mich vor Schlimmerem bewahrt.\\nWelch eine Schande! Ich kann mich nie wieder in der Gesellschaft der Dwemer blicken lassen! Wie sollte ich schon erklären, warum ich für Monate, gar Jahre verschwunden war? Wie sollte ich es so aussehen lassen, als wäre es kein Unfall gewesen? Es müssen Jahre gewesen sein, Nchuleftingth ist leer, wie ausgestorben. Es sind nur noch Maschinen dort, teilweise ist die Anlage in sich zusammengefallen, und aus irgendeinem Grund haben Abenteurer sehr gro��es Interesse an ihr. Ich habe jedoch keinen einzigen Dwemer gesehen.\\n\\nWie lange war ich dort drin? Laut dieser \"Dunmer\", Volyn nennt sie sich, hat sie in ihrem ganzen Leben noch keinen Dwemer gesehen. Und laut eigenen Angaben hat sie in ihrem Leben nicht nur Resdayn, sondern große Teile von ganz Tamriel erkundet. Es sei ein großes Rätsel für alle \"Dwemergelehrten\", was aus meinem stolzen Volk geworden ist. Ist das zu fassen? Dwemergelehrte? Hah.\\nAls ich Volyn zum ersten Mal sah, dachte ich für einen Moment, in dem meine Augen geblendet waren, ich sähe einen Dwemer vor mir, doch wenn das, was sie sagt, wahr ist, dann sind diese \"Dunmer\" wohl nicht unsere Nachkommen. Zum Glück.',},['X']=107247,['Z']=105025,['Y']=19667,},[2]={['Pitch']=1.570971,['SizeZ']=30,['EffectType']=8501,['Yaw']=1.747075,['Id']=1071,['Contrast']=1,['Alpha']=0,['Color']=102439,['SizeX']=26.456456,['Roll']=0,['SizeY']=30,['Groups']=0,['MetaData']={['title']='Duboths Tagebuch, Band 2',['message']='Volyn wollte mich einem dieser \"Dwemergelehrten\" vorstellen, der praktischerweise vor Nchuleftingth ein Lager aufgeschlagen hatte, doch ich bestand darauf, meine wahre Identität geheim zu halten. Er denkt jetzt, ich wäre ein Altmer. Wie einfach zu täuschen er doch war, fast zu einfach. Ich habe ihm ein paar Fragen gestellt, und seine Antworten decken sich mit den Aussagen der \"Dunmer\". Mein Volk verschwand vor über 3000 Jahren in der Schlacht am Roten Berg. Der Rote Berg! Was ist damals geschehen? Haben die Chimer etwa gesiegt? Das ist doch unmöglich. Und woher kommen eigentlich diese \"Dunmer\"? Ich muss mehr erfahren.\\n\\nDie Dunmer sind die Chimer, wie auch immer das Sinn ergeben mag. Ich habe einen ihrer \"lebenden Götter\" getroffen, ein exzentrischer Mer namens Vivec. Seine Art gefällt mir. Er scheint mehr Einblick ins Wesen der Welt zu haben als die anderen seiner Art. Möglicherweise komme ich später einmal hierher zurück, doch Volyn sagte mir, unter dem Land, das sie \"Himmelsrand\" nennen, sei eine gigantische Kaverne entdeckt worden, in der unzählige unerforschte Ruinen der Dwemer liegen. Das muss Fal\\'Zhardum Din sein! Möglicherweise finde ich dort Antworten auf meine Fragen.\\n\\nIch habe eine verlassene Ruine gefunden, die, anders als die meisten, noch nicht einmal von Maschinen bewohnt wird. Der größte Teil von ihr liegt inzwischen unter Eis begraben, doch in dem ohne Weiteres betretbaren Bereich habe ich mir eine Werkstatt eingerichtet. Ich will die Maschinen untersuchen, die noch intakt sind. Vielleicht verraten sie mir mehr über das Verschwinden meines Volkes.\\n\\nAntworten habe ich zwar keine gefunden, aber ich habe eine alte Transportspinne wieder betriebsfähig gemacht. Sie ist noch ein bisschen langsam, ich werde ihre Getriebe näher untersuchen.',},['X']=107247,['Z']=105025,['Y']=19687,},[3]={['Pitch']=1.570971,['SizeZ']=30,['EffectType']=8501,['Yaw']=1.747075,['Id']=1072,['Contrast']=1,['Alpha']=0,['Color']=102439,['SizeX']=26.456456,['Roll']=0,['SizeY']=30,['Groups']=0,['MetaData']={['title']='Duboths Tagebuch, Band 6',['message']='Ich scheine das Unglück regelrecht anzuziehen. Auf meinen Reisen durch Fal\\'Zhardum Din und das darüberliegende Land wurde ich in eine Verschwörung von Vampiren verwickelt, direkt nach meiner Rückkehr nach Resdayn durfte ich einen daedrischen Fürsten davon abhalten, die Welt zu zerstören, was kommt als nächstes?\\nIch will jedenfalls zunächst einmal mehr über diese sagenumwobene Stadt der Uhrwerke erfahren. Ich habe mich mit einem alten Magier getroffen, der den Weg dort hinein kennt. Ich weiß nicht, was mich erwartet, aber nach dem, was ich weiß, ließ sich der Schöpfer teilweise von meinem Volk inspirieren und hat so eine gänzlich künstliche Realität erschaffen. Das ist wirklich ungemein spannend, ich will das gar nicht leugnen.\\n\\nDie Architektur dieses Ortes ist beeindruckend, das sage ich ganz ehrlich. Die Luft ist teilweise etwas stickig und die Seen aus Öl entsprechen auch nicht zwingend meinem Geschmack, aber die Maschinerie übertrifft meine Erwartungen bei weitem. Ich bin mir noch unschlüssig, was ich von den halb-organischen Mechanoiden halten soll, aber das Konzept ist spannend. Und die Faktoten erst! Ich würde zu gerne eines davon näher untersuchen, um die verwendeten Materialien besser zu verstehen.\\n\\nSotha Sil, der Herr dieser Stadt der Uhrwerke, wurde durch einen Doppelgänger ersetzt. Warum hatte ich noch gleich erwartet, dass dies ein entspannter Ausflug wird?\\n\\nIch habe den wahren Sotha Sil getroffen. Er hat sofort erkannt, was ich bin, und eingewilligt, sich mit mir näher über seine Schöpfung und mein Schicksal zu unterhalten. Er ist eine beeindruckende Persönlichkeit. Für einen Dunmer.',},['X']=107247,['Z']=105025,['Y']=19707,},[4]={['Pitch']=0,['SizeZ']=30,['EffectType']=8502,['Yaw']=0.521853,['Id']=1073,['Contrast']=1,['Alpha']=0,['Color']=102439,['SizeX']=26.456456,['Roll']=0,['SizeY']=30,['Groups']=0,['MetaData']={['title']='Duboths private Aufzeichnungen',['message']='Ich bin allein. Jeder, den ich kannte, ist vermutlich tot - oder fort, je nachdem, was aus ihnen wurde. Mein Leben lang diente ich dem Wohl der Dwemer, doch nun? Was ist nun mein Zweck, meine Aufgabe? Ich weiß es nicht. Ich weiß nicht, ob ich so überhaupt leben möchte.\\n\\nVolyn hat mich zu sich eingeladen. Ihr Haus ist an Unordnung kaum zu übertreffen, doch ich schätze ihre Mühen. Warum tut sie das für mich? Sollten unsere Völker sich nicht hassen? Jedenfalls möchte sie, dass ich morgen ihre beiden besten Freunde treffe. Ich will gespannt sein.\\n\\nIhre beiden besten Freunde sind eine sprechende Katze und eine sprechende Echse. Ich hatte keine Erwartungen, doch sie wurden untertroffen.\\n\\nIch nehme meine Aussage zurück. Die beiden sind äußerst fähige Kämpfer und ... ich traue mich kaum, das zu schreiben: Sie scheinen nette, intelligente Persönlichkeiten zu sein. Nun gut, das \"nett\" hängt wohl davon ab, auf welcher Seite ihrer Waffen man sich befindet.\\n\\nIch hatte ein Leben, einen Platz in der Welt, ein hohes Ansehen in der Gesellschaft. Und jetzt? Ich bin allein. Ein Wrack. Kaum fähig, zu existieren.\\n\\nIch bin allein als Dwemer, und doch habe ich so viel Gesellschaft wie noch nie. Ich fühle mich hier willkommener, als ich es in meiner alten Zeit je getan habe. Alle hier kümmern sich auf die ein odere andere Art und Weise umeinander. Es ist ... rührend.\\n\\nVolyn fragte mich, ob ich mit ihr über meine Vergangenheit und meine Gefühle diesbezüglich sprechen möchte. Schockierenderweise ... ja, das tue ich. Ich fühle so viel Schmerz. Ich kann das nicht länger ignorieren.',},['X']=107479,['Z']=104267,['Y']=19615,},},['TS']=1609691134,['HouseId']=80,['World']='eu',},[3]={['Version']='16.0.2',['Effects']={[1]={['X']=0,['SizeZ']=100,['Yaw']=0,['Id']=1045,['EffectType']=614,['Alpha']=1,['Color']=494949,['SizeX']=100,['Roll']=0,['Contrast']=1,['Groups']=0,['Pitch']=0,['SizeY']=100,['Z']=0,['Y']=0,},[2]={['X']=131605,['SizeZ']=1000,['Yaw']=0,['Id']=1067,['EffectType']=64,['Alpha']=0,['Color']=490049,['SizeX']=1000,['Roll']=0,['Contrast']=1,['Groups']=0,['Pitch']=0,['SizeY']=1000,['Z']=125428,['Y']=33528,},[3]={['Pitch']=4.694936,['SizeZ']=50,['EffectType']=8501,['Yaw']=1.012291,['Id']=1075,['Contrast']=1,['Alpha']=1,['Color']=990066,['SizeX']=36.456456,['Roll']=0,['SizeY']=50,['Groups']=0,['MetaData']={['title']='Brief an meine Freunde',['message']='Meine liebsten Gildenfreunde,\\n\\nIch bin mir nicht sicher, warum ich diese Zeilen nun schreibe. Vielleicht, weil mir der Gedanke daran seit Tagen den Schlaf raubt. Vielleicht, weil ich euch endlich nicht mehr darüber anlügen will, wer ich bin.\\n\\nIhr kennt mich als eure Freundin, Mitstreiterin. Doch das bin ich nicht. Ich bin euer Freund, euer Mitstreiter. Wenn über mich als \"sie\" gesprochen wird, windet sich etwas in mir vor Schmerz, denn dieses Wort beschreibt mich nicht. Hat es noch nie.\\n\\nDies ist eine Wahrheit, der ich mir schon lange Zeit bewusst bin, doch ich hatte nie den Mut, sie mit euch zu teilen. Ich hatte zu viel Angst, ihr könntet mich zurückweisen. Aber nun komme ich auf euch zu, und ich möchte euch bitten, mich ab sofort nur noch als \"er\" zu bezeichnen.\\n\\n\\nEs mag für euch zunächst eine Umstellung bedeuten, und wenn ihr Zeit dafür braucht, so sei sie euch gewährt. Doch bitte bedenkt: Was für euch eine kleine Unannehmlichkeit ist, bedeutet für mich die Welt, und was für euch Bequemlichkeit ist, bedeutet für mich großen Schmerz.\\n\\nIch bin immer noch dieselbe Person, die ich vorher war. Doch nun könnt ihr eine neue, größere Wahrheit über mich sehen. Bitte nutzt meine neue Verletzlichkeit nicht aus.\\n\\nMit den besten Grüßen, Daril',},['X']=126895,['Z']=124501,['Y']=33929,},[4]={['Pitch']=0,['SizeZ']=40,['EffectType']=8503,['Yaw']=2.368412,['Id']=1082,['Contrast']=0.320000,['Alpha']=1,['Color']=53149,['SizeX']=30.456456,['Roll']=0,['SizeY']=40,['Groups']=0,['MetaData']={['title']='Automatensterben',['message']='Vergessen ist die alte Stadt\\nseit unvorstellbar langer Zeit;\\nnach tausend Jahren Einsamkeit\\nwacht nur ein letzter Automat.\\n\\nEr kennt den Auftrag, den er hat,\\nals wär er von der Zeit befreit.\\nVergessen ist die alte Stadt\\nseit unvorstellbar langer Zeit.\\n\\nSein Messing ist zerkratzt und matt,\\nsein Ende wahrlich nicht mehr weit.\\nEs bleibt zurück in Schweigsamkeit\\neine Ruine, lebenssatt.\\nVergessen ist die alte Stadt.',},['X']=126939,['Z']=120291,['Y']=23702,},[5]={['Pitch']=1.570971,['SizeZ']=42,['EffectType']=8502,['Yaw']=2.349213,['Id']=1083,['Contrast']=1,['Alpha']=1,['Color']=994380,['SizeX']=26.456460,['Roll']=0,['SizeY']=42,['Groups']=0,['MetaData']={['title']='Strom der Zeit',['message']='Verloren in Vergangenheit,\\nVergessen schon seit langer Zeit:\\nDas Wissen, wie man es herstellt;\\nDie Macht, die es verborgen hält;\\nDer Ort, der seine Kraft befreit.\\n\\nFür immer in Vergessenheit\\nVier Brüderstaaten blutig\\' Streit,\\nWer dieses Erz zum Reichtum zählt.\\nVerloren.\\n\\nNirn ist, regiert von Eitelkeit,\\nFür diese Macht noch nicht bereit.\\nUnd so, wie ihre Schmiede fällt,\\nVerschwindet auch von dieser Welt\\nAetherium, im Strom der Zeit\\nVerloren.',},['X']=126953,['Z']=120268,['Y']=23686,},[6]={['Pitch']=5.054474,['SizeZ']=33,['EffectType']=8501,['Yaw']=2.171190,['Id']=1084,['Contrast']=1,['Alpha']=1,['Color']=998248,['SizeX']=28.456456,['Roll']=0,['SizeY']=33,['Groups']=0,['MetaData']={['title']='Der Preis der Dummheit',['message']='Es war mal ein Dwemer,\\nder war richtig dumm.\\nDer Tag ging schnell um,\\nnur seiner bequemer.\\n\\nEr war Kriegsteilnehmer,\\nes sprach sich herum.\\nEs war mal ein Dwemer,\\nder war richtig dumm.\\n\\nEr wollt\\' es extremer,\\nprobiert\\' etwas stumm,\\ndas brachte ihn um,\\nund dort wächst kein Klee mehr.\\nEs war mal ein Dwemer,\\nder war richtig dumm.',},['X']=126976,['Z']=120254,['Y']=23691,},},['TS']=1610244977,['HouseId']=63,['World']='eu',},[4]={['Version']='16.0.2',['Effects']={},['TS']=1610847404,['HouseId']=42,['World']='eu',},[5]={['Version']='16.2.1',['Effects']={},['TS']=1614620644,['World']='eu',['HouseId']=1,},},['Key']='fx__@vanchningth',['TS']=1614620644,}"
